apub"> • </span> now</p><a class="d3tapubah button white d3tapub" href="https://discord.gg/mF6PcNU" target="blank">Enter chat</a><img class="d3tapubai peep crowd d3tapub" src="/static/art/peep-crowd.svg" loading="lazy" alt="crowd"></section><section class="about d3tapubaj d3tapub"><div class="d3tapubak d3tapub"><a class="d3tapub" href="/c/cJpvbMUB"><img class="polaroid d3tapubal d3tapub" src="/static/art/about-video-cover.jpg" loading="lazy" alt="video"></a></div><div class="d3tapubam d3tapub"><h2 class="d2 d3tapuban d3tapub">About the platform</h2><img class="d3tapubao shape d3tapub" src="/static/art/shape-baby.svg" loading="lazy" alt=""><p class="d4 d3tapub">Scrimba is the next-generation platform for learning how to code. Our screencasts enable you to interact with the code directly in the player. This way, you'll have more fun and learn faster.</p><p class="d3tapubap d4 d3tapub">Our courses cover subjects like HTML, CSS, JavaScript, React, Vue, and more. They're all made with the goal of advancing your career. So pick a course and give your career a boost!</p></div></section><section class="d3tapubaq d3tapub"><div class="leftside d3tapubar d3tapub"><h2 class="d2 d3tapub">Hi! from the founders</h2><div class="content d3tapubas d3tapub"><img class="d3tapubat shape d3tapub" src="/static/art/shape-lilac.svg" loading="lazy" alt=""><p class="d4 d3tapub">Our goal is to create the best possible coding school at the lowest possible cost for students. If we succeed with this, it’ll give anyone who wants to become a software developer a realistic shot at succeeding. Regardless of where they live and the size of their wallets.</p><h2 class="d3tapubau d3tapub">“To achieve this, we’ve created a new video format for code screencasts. We call it “scrims”. </h2><p class="d4 d3tapub">This format is the backbone of our school. Not only because it results in a superior learning experience. But also because it enables us to iterate more quickly, to attract better teachers, to facilitate better peer-learning, to keep server costs low, and much more.</p></div></div><div class="rightside d3tapubav d3tapub"><div class="d3tapubaw d3tapub"><img class="polaroid d3tapubax d3tapub" src="/static/art/founders.jpg" loading="lazy" alt="founders"><h2 class="d3tapubay d3tapub">Sindre & Per</h2></div><div class="connect d3tapubaz d3tapub"><p class="d3tapubba d3tapub">Connect with us on Twitter</p><a class="d3tapubbb button white d3tapub" rel="noreferrer" href="https://twitter.com/sindreaars" target="blank">Say hi @sindreaars</a><a class="d3tapubbc button white d3tapub" rel="noreferrer" href="https://twitter.com/perborgen" target="blank">Say hi @perborgen</a></div></div></section></home-page><site-header id="header" class="p7g3yfk p7g3yfk_   " id="header"><!--  --><a class="logo p7g3yfkm p7g3yfk" href="/" title="home"><app-logo class="p7g3yfkn p7g3yfk ycpjff "><svg class="ycpjff ycpjffcd " width="108" height="72" viewBox="0 0 108 72" fill="none" xmlns="http://www.w3.org/2000/svg"><rect class="ycpjff " x="48" width="60" height="20" rx="10"></rect><rect class="ycpjff " x="25" y="52" width="60" height="20" rx="10"></rect><rect class="ycpjff " x="49" y="26" width="36" height="20" rx="10"></rect><rect class="ycpjff " y="52" width="20" height="20" rx="10"></rect></svg></app-logo></a><!--  --><!--  --><div class="p7g3yfkp p7g3yfk"></div><a class="offer p7g3yfkq p7g3yfk" href="#join">Go Pro!</a><navbar-actions class="n864keb n864keb_ actions p7g3yfk  "><div class="n864kebd n864keb"><a class="button text n864keb" href="/allcourses">All courses</a><a class="button text n864keb" href="#sign-in">Sign in</a><a class="n864kebe button text n864keb" href="#sign-up">Sign up</a></div><div class="n864kebf n864keb"><a class="button text n864kebg n864keb" href="/allcourses">All courses</a><div class="n864kebh me n864keb" tabindex="-1"><div class="avatar n864keb"></div><div class="menu n864kebi n864keb"><a class="item n864keb" href="/dashboard?tab=overview">Dashboard</a><a class="i