		};
		
		if ((e.detail instanceof Scrim) && e.detail.branch) {
			
			// console.log 'enter branch!!',e.detail.branch
			e.detail.branch.enter();
		} else {
			
			let url = e.detail.contextualUrl(store.course || store.playlist);
			document.location.href = url;
			// link ? link.href : e.detail.contextualUrl(store.course or store.playlist)
		};
		// window.store.menuFocus = null
		return imba.commit();
	} catch (e) {
		
		return console.warn('error',e);
	}	// if let typ = window.customElements.get(e.detail.type)
	// let dialog = <{e.detail.type} data=e.detail.data origin=e>
	// imba.mount(dialog)
});

// append stripe
function loadStripe(){
	
	let script = document.createElement('script');
	script.type = 'text/javascript';
	script.src = 'https://js.stripe.com/v3/';
	script.onload = function() { return window.$emit('stripe',null,Stripe); };
	return document.body.appendChild(script);
}
loadStripe();
